import React from "react";

class SearchBox extends React.Component {
  render() {
    return (
      <div>
        <style jsx global>{`
            .searchBox {
                height: 250px;
            }
        }
    `}</style>
        <section className="searchBox">
          <form action="">
            <label id="origen">origen</label>
            <input type="text" />
          </form>
        </section>
      </div>
    );
  }
}

export default SearchBox;
